class Comment extends React.Component {

    render() {
        return (
            <div className="comment">
                <p>{this.props.user}</p>
                <p>{this.props.comment}</p>

                <style jsx>{`
                .comment {
                  margin: 1em;
                  padding: 1em;
                  background-color: lightgray;  
                }
                `}</style>
            </div>
        );
    }
}

export default Comment;
